.hero::after{content:'';position:absolute;inset:0;background:linear-gradient(180deg,rgba(255,255,255,.86),rgba(255,255,255,.75))}
.hero .content{position:relative;z-index:1;padding:60px 0}
.services-grid{display:grid;grid-template-columns:repeat(auto-fit,minmax(240px,1fr));gap:16px}
.service{background:linear-gradient(180deg,rgba(255,255,255,.75),#fff);border:1px solid var(--line);border-radius:12px;padding:16px}
.price{font-weight:800;background:var(--accent);-webkit-background-clip:text;background-clip:text;color:transparent}
.carousel{position:relative;overflow:hidden;border:1px solid var(--line);border-radius:16px;background:#fff}
.carousel-track{display:flex;transition:transform .5s ease} .slide{min-width:100%;position:relative} .slide img{width:100%;display:block}
.arrow{position:absolute;top:50%;transform:translateY(-50%);background:#fff;border:1px solid #e9e2cf;width:40px;height:40px;border-radius:999px;display:flex;align-items:center;justify-content:center;cursor:pointer}
.arrow.left{left:10px} .arrow.right{right:10px}
.carousel-dots{position:absolute;left:0;right:0;bottom:12px;display:flex;justify-content:center;gap:8px}
.dot{width:10px;height:10px;border-radius:50%;background:#ddd;border:1px solid #c9c0a9} .dot.active{background:#c9a33d}
.footer{text-align:center;padding:36px 0 56px;color:var(--muted)} .footer .emblem{height:40px;margin-bottom:8px}
@media(max-width:900px){.links{display:none}}
</style>

<script>
function setupCarousel(root){
  const track = root.querySelector('.carousel-track');
  if(!track) return;
  const slides = Array.from(track.children);
  const dotsEl = root.querySelector('.carousel-dots');
  let idx = 0; const total = slides.length;
  function renderDots(){
    if(!dotsEl) return;
    dotsEl.innerHTML='';
    for(let i=0;i<total;i++){
      const d=document.createElement('div');
      d.className='dot'+(i===idx?' active':'');
      d.addEventListener('click',()=>setSlide(i));
      dotsEl.appendChild(d);
    }
  }
  function setSlide(i){
    idx=(i+total)%total;
    track.style.transform='translateX(-'+(idx*100)+'%)';
    root._idx=idx; renderDots();
  }
  const autoplay = root.dataset.autoplay==='true';
  const interval = parseInt(root.dataset.interval||'4500',10);
  let timer=null; function start(){ if(autoplay){ timer=setInterval(()=>setSlide(idx+1),interval);} }
  function stop(){ if(timer){ clearInterval(timer); timer=null; } }
  root.addEventListener('mouseenter',stop); root.addEventListener('mouseleave',start);
  let startX=0; root.addEventListener('touchstart',e=>{startX=e.touches[0].clientX;stop();},{passive:true});
  root.addEventListener('touchend',e=>{const dx=e.changedTouches[0].clientX-startX; if(dx>40) setSlide(idx-1); else if(dx<-40) setSlide(idx+1); start();});
  renderDots(); start(); root._setSlide=setSlide; root._idx=idx;
}
function prev(el){ const root=el.closest('.carousel'); root&&root._setSlide(root._idx-1); }
function next(el){ const root=el.closest('.carousel'); root&&root._setSlide(root._idx+1); }
document.addEventListener('DOMContentLoaded',()=>{ document.querySelectorAll('.carousel').forEach(setupCarousel); });
</script>
